import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const name ="Will";
  const name2 ="Emma";
  return (
    <div className="App">
      <h1>It's Working! {name} and {name2}</h1>
      <h1>It's Working again!</h1>
      <div>1</div><img src={logo} classname="App-logo"/><div>2</div>
      <p>This is my small text to let me know that everything is working fine</p>
    </div>
  );
}

export default App;
